import React from "react";

const RepositoryItem = ({name, link, fullname}) => {
    return (
        <div>
            <h2>{name}</h2>
            <h2>Fullname:</h2>
            <a href={link}>Lucas-S-Canno/Angular</a>
        </div>
    );
}

export default RepositoryItem;
